import React from "react";
import { Container, Content, View } from "native-base";
import Header from "../../components/Header";
import Typography from "../../components/Typography";
import global from "../../utils/GlobalStyles";
import SuccessImage from "../../assets/images/successillu.svg";

const ChangePasswordSuccess = () => (
  <Container>
    <Header close transparent />

    <Content style={global.wrapper}>
      <View style={global.content}>
        <Typography type="title2" text="You've successfully updated your password." />
      </View>
    </Content>
    <SuccessImage style={{ position: "absolute", right: 0, top: 200 }} />
  </Container>
);

export default ChangePasswordSuccess;
